import React from 'react';
import Link from 'next/link';
import NavStyles from './styles/NavStyles';

const Nav = () => (
  <NavStyles>
     <Link href="/">
        <a>Linxify</a>
    </Link>
  </NavStyles>
);

export default Nav;
